INSERT INTO `projetos` VALUES (1,'60+','projeto de idosos',1,'122333','2023-04-12','2024-04-12',NULL,1),(2,'Ifsc 60+','1',1,'1','2024-02-11','2025-02-11',NULL,1),(3,'Elas Digitais','Mulheres na STEM',1,'2019','2019-04-12','2025-04-12',NULL,1),(4,'Etnomatemática','Etnomatemática e possibilidade de utilização de jogos africanos',1,'2024','2024-06-11','2025-06-11',NULL,1),(5,'NEABI','Núcleo de Ensino e Pesquisa Afro-Brasileiro e Indígena',1,'2021','2021-04-12','2026-04-12',NULL,1),(6,'Clube de Mídia','Clube de fotografia e pesquisa',1,'2023','2023-03-12','2026-04-23',NULL,1),(7,'Libras','Libras',1,'12','2024-02-12','2026-02-12',NULL,1),(8,'Geografia','123',1,'12','2023-05-12','2025-05-12',NULL,1),(9,'Arduíno','ee',1,'12','2024-03-12','2026-03-12',NULL,1),(10,'Filosofia','Uhul',1,'12','2024-07-12','2026-07-12',NULL,1),(11,'História','História',1,'12','2024-09-12','2027-09-12',NULL,1),(12,'uu','ee',1,'16','2022-08-12','2025-08-12',NULL,1),(13,'eee','eee',1,'17','2024-02-06','2026-02-06',NULL,1),(14,'Biologia','eeeeee',1,'10','2024-10-12','2025-10-12',NULL,1),(15,'Ambiental','eeeeee',1,'12','2024-06-30','2025-06-30',NULL,1),(16,'aa','aaa',1,'aaa','2006-01-09','2006-12-09','2008-09-07',1),(17,'teste','ssss',1,'123456','2007-07-09','2009-08-09',NULL,1),(18,'A Estética das Pequenas Coisas na Arte Contemporânea Brasileira','Este projeto de pesquisa propõe uma investigação sobre como elementos do cotidiano — objetos, gestos, rotinas e experiências comuns — são ressignificados e transformados em expressão artística na arte contemporânea brasileira. Através da análise de obras visuais, performances e instalações de artistas que exploram a estética do trivial, busca-se compreender como a arte se aproxima da vida real, revelando beleza, crítica e sensibilidade nas pequenas coisas.',1,'Edital PROPPI Nº 04/2024','2024-04-12','2026-07-12','2026-10-20',1);
